import "./TripStyles.css";
import TripData from "./TripData";
import des5 from "../assets/des5.jpg";
import des6 from "../assets/des6.jpg";
import des7 from "../assets/des7.jpg";

function Trip() {
  return (
    <div className="trip">
      <h1>Recent Trips</h1>
      <p>You Can discover unique destinations using Trippy</p>

      <div className="tripcard">
        <TripData
          image={des5}
          heading="Trip in Australia"
          text="Embark on an unforgettable journey to Australia, a land of stunning contrasts and unparalleled beauty. From the iconic Sydney Opera House to the breathtaking landscapes of the Outback and the vibrant colors of the Great Barrier Reef, every moment is a new adventure waiting to be discovered. Dive into crystal-clear waters teeming with marine life, hike through ancient rainforests, or immerse yourself in Aboriginal culture. Whether you're seeking adrenaline-fueled thrills or serene moments of reflection, Australia offers an unparalleled experience that will leave you with memories to cherish forever. Welcome to the land Down Under, where the possibilities are endless."
        />

        <TripData
          image={des6}
          heading="Trip in Manali"
          text="Experience the enchanting allure of Manali, a Himalayan gem beckoning with snow-capped peaks, verdant valleys, and pristine rivers. Explore ancient temples like Hadimba Devi, and rejuvenate in Vashisht's natural hot springs. Thrill-seekers can tackle Solang Valley's adventure sports, from paragliding to skiing. Delight in Himachali cuisine and shop for local treasures in Old Manali's markets. As dusk falls, gather around a bonfire, gazing at starlit skies and sharing tales. Manali promises a blend of tranquility and adrenaline, making it an unforgettable retreat amidst nature's grandeur."
        />

        <TripData
          image={des7}
          heading="Trip in Kerela"
          text="Embark on an enchanting journey to Kerala, India's serene southern state famed for its lush landscapes, tranquil backwaters, and vibrant culture. Cruise through the scenic backwaters of Alleppey on a traditional houseboat, marveling at the verdant rice paddies and coconut groves that line the waterways. Explore the historic port city of Kochi, where ancient Chinese fishing nets mingle with colonial architecture and bustling spice markets. Indulge in authentic Keralan cuisine, savoring fragrant curries, fresh seafood, and crispy dosas. Immerse yourself in the rich heritage of Kathakali dance performances and Ayurvedic wellness treatments. Kerala is a sensory delight, offering a glimpse into India's soul."
        />
      </div>
    </div>
  );
}

export default Trip;
